import React, { Components } from 'react'
import './index.scss'

const Switch = () => {
    return (
        <label className="toggleSwitch nolabel" onclick="">
            <input type="checkbox" checked />
            <span>
                <span onClick={()=>this.toggleState()}>OFF</span>
                <span>ON</span>
            </span>
            <a />
        </label>
    )
}

export { Switch }
